def project(x, prec=64):
	if prec == 64:
		# do not use mpmath (standard precision with Python is 64 bits)
		v = abs(x)
		v = v-int(v)
		if v == 0:
			raise ValueError(f'Cannot project integers (given x={x})')
		s = str(v).replace('.','')
		if 'e' in s:
			s = s[:s.find('e')]
		v = int(s[-1])
		for k in range(2, len(s)+1):
			v = 1. / v + int(s[-k])
		return v
	with _mp.workprec(prec):
		# use mpmath
		v = abs(_mp.mpf(x))
		v = v-_mp.floor(v)
		if v == 0:
			raise ValueError(f'Cannot project integers (given x={x})')
		s = str(v).replace('.','')
		if 'e' in s:
			s = s[:s.find('e')]
		v = _mp.mpf(s[-1])
		for k in range(2, len(s)+1):
			v = 1 / v + _mp.mpf(s[-k])
		return v


@cuda.jit(device=True)
def _project_gpu(x):
	v = abs(x)
	v = v-int(v)
	if v == 0:
		return v
	u = int(x*1_000_000_000_000_000)
	v = u % 10
	for _ in range(15):
		u //= 10
		if v != 0:
			v = 1. / v + int(u % 10)
		else:
			v = u % 10
	return v

@cuda.jit(device=True)
def _get_cycle_gpu(x, cycles, i):
	v = x
	for t in range(14):
		v = v * 10 % 10 # Assumes that the first digit is always 0 and skips it. (as in 0.13899, 0.757476, etc.)
		cycles[i, 18 + t] = int(v)
	v = x
	for t in range(500):
		tm = t%18
		if v%1 == 0:
			cycles[i, -1] = t
			return
		v = _project_gpu(v)
		li = list_index(cycles[i], v)
		if li >= 0:
			if li < tm:
				cl = tm - li
				for _i in range(tm, 18):
					cycles[i, _i] = 0
				for _i in range(li):
					cycles[i, _i] = 0
			else:
				cl = 18 - li + tm
				for _i in range(tm, li):
					cycles[i, _i] = 0
			cycles[i, -2] = cl
			cycles[i, -1] = t
			return
		cycles[i, tm] = v
	# print(cycles[i])
	# print(f'No cycle found for x = {x} within 500 iterations!')
	cycles[i, -1] = t

@cuda.jit()
def cuda_kernel_get_cycle_many(xs: _np.ndarray, cycles: _np.ndarray):
	i = cuda.grid(1)
	_get_cycle_gpu(xs[i], cycles, i)

def get_cycle_data_gpu(xs: _np.ndarray[float]) -> tuple[_np.ndarray, _np.ndarray, _np.ndarray, _np.ndarray]:
	'''
	Return a 4-tuple of the form `(cycles, cycle lengths, iterations to convergence, decimal expansion of inputs)`.
	'''
	threads = min(1024, int(2 ** int(0.5 + _np.log2(_np.sqrt(xs.shape[0])))))
	blocks = xs.shape[0] // threads
	_xs = cuda.to_device(xs)
	_cycle_info = cuda.device_array((_xs.shape[0], 34))
	cuda_kernel_get_cycle_many[blocks, threads](_xs, _cycle_info)
	A = _cycle_info.copy_to_host()
	cl = A[:, -2].astype(int)
	return A[:, :18], _np.where(cl == 0, 18, cl), A[:, -1].astype(int), A[:, 18:-2].astype(int)

@cuda.jit(device=True)
def list_index(list, value):
	for i, v in enumerate(list):
		if v == value:
			return i
	return -1

def get_cycle_data(x, prec=64, max_iterations=1000):
	'''
	Return cycle (with the first value in the list being the smallest value in the known cycle), and the number of iterations taken to converge to the cycle with the given precision.
	'''
	with _mp.workprec(prec):
		v = x
		vs = []
		for t in range(max_iterations):
			if v%1 == 0:
				return [], t
			v = project(v, prec=prec) # doesn't use mpmath if prec=64
			if v in vs:
				cycle = vs[vs.index(v):]
				i = _np.argmin(cycle)
				if i > 0:
					cycle = cycle[i:] + cycle[:i] # shift so that min value is "first" in cycle
				return cycle, t
			vs.append(v)
		print(f'No cycle found for x = {x} within {max_iterations} iterations!')
		return [], t


